svg.script:
let b_angle = 0;
let r_angle = 0;
let o_angle = 0;
let y_angle = 0;
let pump_speed = 160;
let arrows_shift = 1;
let animation_id;
let allow_play = true;
let setint;

function $(sel) {
  return document.querySelector(sel);
}

$("#popup_demo_close").onclick = function() {
  $("#popup_demo").classList.toggle("invis");
  setTimeout(function(){$("#popup_demo").classList.toggle("none")}, 100);
};

$("#popup_prima_pin_close").onclick = function() {
  $("#popup_prima_pin").classList.toggle("invis");
  setTimeout(function(){$("#popup_prima_pin").classList.toggle("none")}, 100);
};

$("#popup_prima_stage_close").onclick = function() {
  $("#popup_prima_stage").classList.toggle("invis");
  setTimeout(function(){$("#popup_prima_stage").classList.toggle("none")}, 100);
};

$("#popup_balance_close").onclick = function() {
  $("#popup_balance").classList.toggle("invis");
  setTimeout(function(){$("#popup_balance").classList.toggle("none")}, 100);
};

$("#popup_spring_close").onclick = function() {
  $("#popup_spring").classList.toggle("invis");
  setTimeout(function(){$("#popup_spring").classList.toggle("none")}, 100);
};

$("#popup_second_stage_close").onclick = function() {
  $("#popup_second_stage").classList.toggle("invis");
  setTimeout(function(){$("#popup_second_stage").classList.toggle("none")}, 100);
};

$("#popup_second_seat_close").onclick = function() {
  $("#popup_second_seat").classList.toggle("invis");
  setTimeout(function(){$("#popup_second_seat").classList.toggle("none")}, 100);
};

function info_show() {
if($("#popup_demo").classList.contains("none") || $("#popup_prima_pin").classList.contains("none") || $("#popup_prima_stage").classList.contains("none") || $("#popup_balance").classList.contains("none") || $("#popup_spring").classList.contains("none") || $("#popup_second_stage").classList.contains("none") || $("#popup_second_seat").classList.contains("none")) {
    $("#popup_demo").classList.remove("invis");
    $("#popup_prima_pin").classList.remove("invis");
    $("#popup_prima_stage").classList.remove("invis");
    $("#popup_balance").classList.remove("invis");
    $("#popup_spring").classList.remove("invis");
    $("#popup_second_stage").classList.remove("invis");
    $("#popup_second_seat").classList.remove("invis");
    setTimeout(function(){
      $("#popup_demo").classList.remove("none");
      $("#popup_prima_pin").classList.remove("none");
      $("#popup_prima_stage").classList.remove("none");
      $("#popup_balance").classList.remove("none");
      $("#popup_spring").classList.remove("none");
      $("#popup_second_stage").classList.remove("none");
      $("#popup_second_seat").classList.remove("none");
    }, 100);
  } else {
    $("#popup_demo").classList.toggle("invis");
    $("#popup_prima_pin").classList.toggle("invis");
    $("#popup_prima_stage").classList.toggle("invis");
    $("#popup_balance").classList.toggle("invis");
    $("#popup_spring").classList.toggle("invis");
    $("#popup_second_stage").classList.toggle("invis");
    $("#popup_second_seat").classList.toggle("invis");
    setTimeout(function(){
      $("#popup_demo").classList.toggle("none");
      $("#popup_prima_pin").classList.toggle("none");
      $("#popup_prima_stage").classList.toggle("none");
      $("#popup_balance").classList.toggle("none");
      $("#popup_spring").classList.toggle("none");
      $("#popup_second_stage").classList.toggle("none");
      $("#popup_second_seat").classList.toggle("none");
    }, 100);
  }
}

$("#info").onclick = function() {
  info_show();
}

setTimeout(function(){
  info_show();
}, 400);

function bars_upd() {
  if(allow_play) {
      animation_id = requestAnimationFrame(animate);
    }
  allow_play = false;
  if(r_angle < 50) {
    $("#bar3_circle").setAttribute("fill", "#FFFF63");
    $("#bar3_arr").setAttribute("fill", "#FFFF63");
    $("#pipe11").setAttribute("fill", "url(#hor_yllw)");
    $("#pipe12").setAttribute("fill", "url(#hor_yllw)");
    $("#pipe13").setAttribute("fill", "url(#hor_yllw)");
    $("#pipe14").setAttribute("fill", "url(#hor_yllw)");

    $("#pipe15").setAttribute("fill", "url(#ver_yllw)");
    $("#pipe16").setAttribute("fill", "url(#ver_yllw)");
    $("#pipe17").setAttribute("fill", "url(#ver_yllw)");

    $("#secondary_pin").setAttribute("transform", "translate(0 30)");
    $("#secondary_spring").setAttribute("transform", "translate(1369 495) scale(1 .83) translate(-1369 -495)");
  }
  if(r_angle >= 50) {
    $("#red_arrow2").setAttribute("transform", "rotate(" + r_angle + " 787.2 906.75)");

    $("#bar3_circle").setAttribute("fill", "#fbce27");
    $("#bar3_arr").setAttribute("fill", "#fbce27");
    $("#pipe1").setAttribute("fill", "url(#hor_org)");
    $("#pipe2").setAttribute("fill", "url(#hor_org)");
    $("#pipe3").setAttribute("fill", "url(#hor_org)");
    $("#pipe4").setAttribute("fill", "url(#hor_org)");
    $("#pipe5").setAttribute("fill", "url(#hor_org)");
    $("#pipe6").setAttribute("fill", "url(#hor_org)");
    $("#pipe7").setAttribute("fill", "url(#ver_org)");
    $("#pipe8").setAttribute("fill", "url(#hor_org)");

    $("#pipe9").setAttribute("fill", "url(#ver_org)");
    $("#pipe10").setAttribute("fill", "url(#ver_org)");

    $("#bar2_circle").setAttribute("fill", "#fbce27");
    $("#bar2_arr").setAttribute("fill", "#fbce27");
    $("#pipe11").setAttribute("fill", "url(#hor_org)");
    $("#pipe12").setAttribute("fill", "url(#hor_org)");
    $("#pipe13").setAttribute("fill", "url(#hor_org)");
    $("#pipe14").setAttribute("fill", "url(#hor_org)");

    $("#pipe15").setAttribute("fill", "url(#ver_org)");
    $("#pipe16").setAttribute("fill", "url(#ver_org)");
    $("#pipe17").setAttribute("fill", "url(#ver_org)");

    $("#secondary_pin").setAttribute("transform", "translate(0 0)");
    $("#secondary_spring").setAttribute("transform", "translate(1369 495) scale(1 1) translate(-1369 -495)");

    $("#primary_pin").setAttribute("transform", "translate(0 30)");
    $("#primary_top").setAttribute("transform", "translate(943 293.24) scale(1 1.38) translate(-943 -293.24)");

  }
  if(r_angle >= 150) {
    $("#red_arrow1").setAttribute("transform", "rotate(" + r_angle + " 433.42 906.75)");
    $("#red_arrow2").setAttribute("transform", "rotate(" + r_angle + " 787.2 906.75)");
    $("#blue_arrow").setAttribute("transform", "rotate(" + (r_angle - 125) + " 433.39 169.16)");

    $("#bar2_circle").setAttribute("fill", "#FFB8B8");
    $("#bar2_arr").setAttribute("fill", "#FFB8B8");
    $("#bar3_circle").setAttribute("fill", "#FFB8B8");
    $("#bar3_arr").setAttribute("fill", "#FFB8B8");

    $("#pipe1").setAttribute("fill", "url(#hor_red)");
    $("#pipe2").setAttribute("fill", "url(#hor_red)");
    $("#pipe3").setAttribute("fill", "url(#hor_red)");
    $("#pipe4").setAttribute("fill", "url(#hor_red)");
    $("#pipe5").setAttribute("fill", "url(#hor_red)");
    $("#pipe6").setAttribute("fill", "url(#hor_red)");
    $("#pipe7").setAttribute("fill", "url(#ver_red)");
    $("#pipe8").setAttribute("fill", "url(#hor_red)");

    $("#pipe9").setAttribute("fill", "url(#ver_red)");
    $("#pipe10").setAttribute("fill", "url(#ver_red)");

    $("#pipe11").setAttribute("fill", "url(#hor_red)");
    $("#pipe12").setAttribute("fill", "url(#hor_red)");
    $("#pipe13").setAttribute("fill", "url(#hor_red)");
    $("#pipe14").setAttribute("fill", "url(#hor_red)");

    $("#pipe15").setAttribute("fill", "url(#ver_red)");
    $("#pipe16").setAttribute("fill", "url(#ver_red)");
    $("#pipe17").setAttribute("fill", "url(#ver_red)");

    $("#primary_pin").setAttribute("transform", "translate(0 0)");
    $("#primary_top").setAttribute("transform", "translate(943 293.24) scale(1 1) translate(-943 -293.24)");
  }
}

function pump_dwn() {
  if(pump_speed > 160) {
    pump_speed -= 5;
    $("#pump_speed").setAttribute("stroke-dashoffset", pump_speed);
  }
  bars_upd();
}

function pump_up() {
  if(pump_speed < 320) {
    pump_speed += 5;
    $("#pump_speed").setAttribute("stroke-dashoffset", pump_speed);
  }
  bars_upd();
}

$("#pump_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){pump_dwn()}, 200);
}
$("#pump_left").onclick = function() {pump_dwn()};
$("#pump_left").onmouseup = function() {
  clearInterval(setint);
};

$("#pump_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){pump_up()}, 200);
}
$("#pump_right").onclick = function() {pump_up()};
$("#pump_right").onmouseup = function() {
  clearInterval(setint);
};

function rarr_dwn() {
  if(r_angle > 0) {
    r_angle -= 5;
    $("#red_arrow3").setAttribute("transform", "rotate(" + r_angle + " 1141 906.75)");
    bars_upd();
  }
}

function rarr_up() {
  if(r_angle < 300) {
    r_angle += 5;
    $("#red_arrow3").setAttribute("transform", "rotate(" + r_angle + " 1141 906.75)");
    bars_upd();
  }
}

$("#rb_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_dwn()}, 200);
}
$("#rb_left").onclick = function() {rarr_dwn()};
$("#rb_left").onmouseup = function() {
  clearInterval(setint);
};

$("#rb_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_up()}, 200);
}
$("#rb_right").onclick = function() {rarr_up()};
$("#rb_right").onmouseup = function() {
  clearInterval(setint);
};

function animate() {
  if(arrows_shift < 50) {
    arrows_shift += (pump_speed / 160 - 1) * 3;
    $("#q_01").setAttribute("transform", "translate(" + arrows_shift * -1 + " 0)");
    $("#q_02").setAttribute("transform", "translate(0 " + arrows_shift + ")");
    $("#q_03").setAttribute("transform", "translate(" + arrows_shift + " 0)");
    $("#q_04").setAttribute("transform", "translate(0 " + arrows_shift + ")");
    $("#q_05").setAttribute("transform", "translate(" + arrows_shift + " 0)");
    $("#q_06").setAttribute("transform", "translate(0 " + arrows_shift * -1 + ")");
    $("#q_07").setAttribute("transform", "translate(" + arrows_shift + " 0)");
    $("#q_08").setAttribute("transform", "translate(0 " + arrows_shift + ")");
  } else {
    arrows_shift = 1;
  }
    animation_id = requestAnimationFrame(animate);
}
